import React from 'react'

function Form({updateCredit}) {
  function handleSubmit(event){
    updateCredit(event.target.vale);
  }

  function updateState(event){
    setState(event.target.vale)
  }


  return (
    <div>
        <form onSubmit={handleSubmit}>
            <input type="text" onChange={updateState} placeholder='Desciption'/>
            <input type="text" name="" id="" placeholder='Amount'/>
            <button type='submit'>Submit Transactions</button>
        </form>
    </div>
  )
}

export default Form
